import React from "react";
import "./hero.css";

const HeroSection = () => {
  return (
    <main className="hero container" id="hero">
      <div className="hero-content">
        <h1>Your feet deserve the best,</h1>
        <p>
          Your feet deserve the best, that's why we're here to help you with our shoes. Run, walk, jump,... all while feeling confortable, because shoes shouldn't be a husle.
        </p>

        <div className="btn-danger hero-btn">
          <button>Shop Now </button>
          <button className="secondary-btn">Category</button>
        </div>

        <div className="shopping">
          <p>Also Available On</p>

          <div className="brand-icons">
            <img src="/images/amazon.png" alt="amazon-logo" />
            <img src="/images/flipkart.png" alt="flipkart-logo" />
          </div>
        </div>
      </div>
      <div className="hero-image">
        <img src="/images/hero-image.png" alt="hero" />
      </div>
    </main>
  );
};

export default HeroSection;
